      {
        'name' : 'Nathan Sumilang',
        'description' : 'TODO'
      },
      {
        'name' : 'TODO Name',
        'description' : 'TODO description'
      }
    ];
    const forms = [
      {
        'url' : 'TODO URL',
        'title' : 'TODO Title',
        'sample' : 'TODO Image'
      }
    ];
    //TODO : Add images to the slideshow
    const slideImages = [];
    return(
      //<AboutUs />
      <div>
        <Doctor doctor={doctors} />
        <FormPDF form={forms} />
        <ContactUs />
      </div>
    );
  }
}
