const Doctor = props =>{
  const doctors = props.doctor.map((doctor, index) =>{
    return(
      <div key={index}>
        <div>{doctor.name}</div>
        <div>{doctor.description}</div>
      </div>
    );
  });
  return <section id="doctors" className="container-fluid">{doctors}</section>
};
