*/
const FormPDF = props =>{
  const forms = props.form.map((form,index) =>{
    return(
      <div key={index}>
        <a href={form.URL}>
          <image href={form.sample} />
          <p>{form.title}</p>
        </a>
      </div>
    )
  });
  return <section id="forms" className="container-fluid">
      <h2>Forms</h2>
      {forms}
    </section>
};

const ContactUs = () =>{
  return(
    <section className="container-fluid">
      <h1>Contact Us</h1>
      <h3>Email: </h3>
      <h3>Phone Number: </h3>
      <h3>Address: </h3>
      <p>Address Line 1</p>
      <p>City, State Zip</p>
    </section>
  );
}

export default Section;
